query TargetingHcp($targetingFilters: TargetingFilters!, $pagination: Pagination!, $sort: TargetingSort!) {
  targetingHcp(filters: $targetingFilters, pagination: $pagination, sort: $sort) {
    count
    items {
      npi
      procedureVolume
      opportunityValue
      productVolume
      salesAmount
      comparisonVolume
      hcp {
        npi
        ...HcpMetadataFragment
        ...HcpTaxonomiesFragment
        affiliations(where: {rank: {_eq: 1}}) {
          ...HcpAffiliationInfoFragment
          __typename
        }
        ...ProductUserFragment
        __typename
      }
      __typename
    }
    __typename
  }
}

