query QbtMarketsProcedureDiagnosisGroups($limit: Int!, $offset: Int!, $orderBy: MarketsProcedureDiagnosisGroupsSortField!, $filters: MarketsProcedureDiagnosisGroupsFilters!, $userId: Int, $userGroupIds: [Int!], $targetingStrategyStatus: targeting_strategy_status_enum) {
  marketsProcedureDiagnosisGroups(
    filters: $filters
    pagination: {limit: $limit, offset: $offset}
    sort: {field: $orderBy, order: desc}
  ) {
    count
    items {
      groupId
      annualVolume
      hcpCount
      socCount
      filter_option_group {
        id
        name
        field
        values
        owner_id
        product_filter_option_groups {
          product {
            id
            name
            __typename
          }
          __typename
        }
        targeting_strategies(
          where: {targeting_strategy: {_or: [{user_group_id: {_in: $userGroupIds}}, {user_group_id: {_is_null: true}}, {owner: {id: {_eq: $userId}}}], status: {_eq: $targetingStrategyStatus}}}
        ) {
          targeting_strategy {
            id
            name
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

